// Navbar.js

import React from "react";

const Navbar = () => {
  return (
    <nav className=" p-4 flex justify-between items-center">
      {/* Left Side - Logo */}
      <div className="text-black font-bold">
        <span>Logo</span>
      </div>

      {/* Right Side - Links */}
      <div className="space-x-4">
        <a href="#" className="text-black">
          Link 1
        </a>
        <a href="#" className="text-black">
          Link 2
        </a>
      </div>
    </nav>
  );
};

export default Navbar;
